description.text:
I never go out...
...without my loupe.
===
I always have one with me, but it's hard to find quality lenses that also come<br />
with a lightweight fitting.<br />
Here's my solution...
===<br />
Do not print the provided EXAMPLE files, create your own Folding Lens with OpenSCAD.
The parameters are well documented (tm) and should (tm) be easy to understand.
Inside the file, you'll also find:<br />
<code ><br />
// ===<br />
// CHOOSE MODE HERE<br />
//<br />
//   0 = EDIT LENS ONLY<br />
//   1 = EDIT FITTING<br />
//   2 = EDIT FITTING WITH CLAMP<br />
//   3 = EDIT CLAMP<br />
//   4 = EDIT SIMPLE COVER (AND FITTING)<br />
//   5 = EDIT SLIDE COVER<br />
//<br />
//   9 = PRESENTATION MODE<br />
//<br />
//  10 = PRINT FITTING<br />
//  11 = PRINT CLAMP<br />
//  12 = PRINT SIMPLE COVER<br />
//  13 = PRINT SLIDE COVER<br />
//<br />
MODE = 9;<br />
</code>
Use MODE 0..9 for editing or viewing and 10..13 for exporting the single parts.
